import React from 'react';
import Header from './components/Header/header';
import Flashcards from './components/Flashcards/flashcards';

function App(prop) {
    return (
        <div className="App">
            <Header />
            <main>
                <Flashcards />
            </main>
            <footer>
                <p>&copy; 2024 ReNewCycle Project</p>
                <p>INFO 442</p>
            </footer>
        </div>
    );
}

export default App;
